window.bookSummaryJSON = "<p>For James Bond and the British Secret Service, the stakes couldn't be higher. 007's mission is to neutralize the Russian operative Le Chiffre by ruining him at the baccarat table, forcing his Soviet masters to \"retire\" him. When Le Chiffre hits a losing streak, Bond discovers his luck is in - that is, until he meets Vesper Lynd, a glamorous agent who might yet prove to be his downfall. </p> <p>This audiobook includes an exclusive bonus interview with Dan Stevens.</p> <p>Blackstone Audio, Inc. James Bond and 007 are registered trademarks of Danjaq LLC, used under license by Ian Fleming Publications Ltd</p>"; 
